const one = [
    "e4",
    "e5",
    "♘f3"
]

const two = [
    "e4",
    "e5",
    "♘f3",
    "♝b4"
]

function reshape(array) {
    const result = [];
    let tempArray = [];
    for (const element of array) {
        result.push(element)
    };

    return result
};

console.log('one', reshape(one))
console.log('two', reshape(two))
